  [],\n\t\"revision_timestamp\": \"2013-03-15T12:24:16.054879\",\n\t\"name\": \"field-plot-and-observation-points-for-dinosaur-national-monument-vegetation-mapping-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This point file displays the 727 vegetation
  plots and 217 observation points visited in 2002, 2003 and 2004 as part of the vegetation
  mapping project. Plots and observation points were located subjectively in representative
  vegetation throughout the park. Field crews decided where and when to use observation
  points or vegetation plots to sample the vegetation. Vegetation plots were placed
  in stands judged by field crews to represent legitimate vegetation types that could
  be classified to the National Vegetation Classification (NVC) system using standard
  multivariate analysis techniques. Observation points were placed in stands (1) if
  the vegetation was highly altered and therefore not classifiable, (2) to provide
  information about the distribution of common vegetation types adequately sampled
  in vegetation plots, or (3) if the stand represented a unique vegetation type that
  was too small to hold a 400m2 sample plot (e.g., seeps, hanging gardens). The points
  were originally GPSed (using recreational GPS units), coordinates noted on the field
  sheets and then typed into the database. Field photos are associated with each plot.\",\n\t\"license_title\":
